ht.columns.drawCell:
__ht__function (g, text, rect, option) {
            var defaultDraw = option.defaultDraw,
                row = option.row,
                x = rect.x,
                y = rect.y - 1,
                width = rect.width,
                height = rect.height - 3;
            g.beginPath();
            g.moveTo(x, y);
            g.lineTo(x + width, y);
            g.lineTo(x + width, y + height);
            g.lineTo(x, y + height);
            g.closePath();
            g.fillStyle = 'rgba(163,46,59,1.0)';
            g.fill();

            defaultDraw();
        }

